import * as React from 'react'

const Logo = ({ width = 1500, height = 359, svgWwidth, svgHeight }) => {
  const svgProps = {}
  if (height) {
    Object.assign(svgProps, { height })
  }
  if (width) {
    Object.assign(svgProps, { width })
  }
  if (svgHeight) {
    Object.assign(svgProps, { svgHeight })
  }
  if (svgWwidth) {
    Object.assign(svgProps, { svgWwidth })
  }
  return (
    <svg
      viewBox="0 0 900 871"
      height={svgProps.svgHeight}
      width={svgProps.svgWwidth}
    >
      <defs>
        <image
          height={svgProps.height}
          width={svgProps.width}
          id="prefix__img1"
          href="data:image/png;base64,"
        />
      </defs>
      <style />
      <use id="prefix__Background" href="#prefix__img1" x={0} y={0} />
    </svg>
  )
}

export default Logo
